const Rank=({rank,name})=>{
  return (  !(name.length)===0 ? <div className='pa2 dib'>
                                <div className='f3 white'>{`Hello ${name} Yor Rank Is ...`}</div>
                                <div className='f2 white'>{`${rank}`}</div>
                              </div>
                              :
                               <div>
                                  <div>
                                    <h1>Please Login to check your Rank</h1>
                                  </div>
                              </div>);
}
export default Rank;
